                    <FontAwesomeIcon id="pro-rate" icon={faStarHalfAlt}/>&nbsp;&nbsp;
                    <span className="d-inline-block average-rating">3.5</span>
                </div> */}
            </div>
        </div>
        </Link>

        </div>

    )
})}
    </article>
<Link to='/doctors'>
<button className="btn view-btn">Read More</button>
</Link>
        
    </article>
</Container>
    )
}
